import React from 'react'
import './serch-box.styles.css'

export const SerchBox = ({placeholder, handlechange}) => {

  (<div>
    <input
      className='search'
      type='search'
      placeholder={placeholder}
      onChange={handlechange}
    />
  </div>)

}
